const Section3Home = () => {
  return (
    <section>
      <div className="container">
        <div className="section3-body">
          <img src="imagess/About - Image.png" alt="" />
          <div className="section3-content">
            <h1>مرحبا انا نور صبحي </h1>
            <p>مسؤولة على المركز</p>
            <p>
              نحن نعمل هنا منذ وقت طويل جدا لرعاية الاطفال ولدينا كادر مؤهل
              ،نعمل مبكفاءات دولية ومعدات عالمية
              <br />
              <input type="submit" value="شاهد المزيد" />
            </p>
          </div>
        </div>
      </div>
    </section>
  );
};
export default Section3Home;
